/*  - class a.A with four constructors:    - private A(byte)    - package A(short)    - protected A(int)    - public A(long)*/package a;public class A {  private A(byte a) {    System.out.println("A.A(byte)");  }  A(short a) {    System.out.println("A.A(short)");  }  protected A(int a) {    System.out.println("A.A(int)");  }  public A(long a) {    System.out.println("A.A(long)");  }}